  [],\n\t\"revision_timestamp\": \"2016-07-27T22:21:58.556866\",\n\t\"name\": \"wildlife-inventory-plan-minnesota-valley-national-wildlife-refuge\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The goals for this Wildlife Inventory Plan
  for Minnesota Valley NWR are: (1) to provide as good a survey method as possible
  to estimate population levels of key refuge species at times of the year that are
  critical to those species, or during those periods that are the only practical times
  of the year to count certain key species; (2) to describe a standard survey method
  that will allow trends in key wildlife populations to be monitored over several
  years even if exact numbers are not 100% accurate; and (3) to detail the minimum
  number of wildlife surveys that are necessary to monitor key wildlife populations
  on the refuge, stressing quality of surveys over quantity.\",\n\t\"license_title\":
